import React from 'react';
import './App.css';

function App(){
  return (
    <div style={{fontFamily: 'Arial, sans-serif', textAlign:'center', padding: '4rem'}}>
      <h1>Dashboard</h1>
      <p>This is a minimal React dashboard scaffold.</p>
      <p>Run <code>npm start</code> inside the `dashboard` folder to launch the app.</p>
    </div>
  );
}

export default App;
